window.bookSummaryJSON = "<p>Both vampires and humans have been targeted, but if there is one thing those who work with Bethany Anne learn, it is that you are never forsaken. </p> <p>This time, Bethany Anne is after Anton, who has something, or someone, Bethany Anne wants back. </p> <p>Can she find out where he is and break in to save the Patriarch if he is still alive? </p> <p>Or is it a trap? Will Anton, with his centuries of experience, have the final laugh at both of their expenses? </p> <p>This time, Bethany Anne is up against one of Michael’s direct children, who is one of the most powerful vampires in existence. </p> <p>Don’t miss the reunion. </p> <p>Performed by Colleen Delany, Emily Beresford, James Konicek, Terence Aselford, Michael John Casey, Steve Wannall, Bianca Bryan, Christopher Graybill, Rob McFadyen, Eva Wilhelm, Eric Messner, Niusha Nawab, Bradley Foster Smith, Matthew Schleigh, Matthew Pauli, James Lewis, Nora Achrati, Christopher Williams, Matthew Bassett, Danny Gavigan, Kay Eluvian, Joel David Santner, Anthony Palmini, Alejandro Ruiz, Wyn Delano, Jacob Yeh, Tanja Milojevic, Yasmin Tuazon, Brandon Burton, Holly Adams, Ken Jackson, Robb Moreira, Zeke Alton, Patrick Bussink, Jonathan Lee Taylor, Darius Johnson, Nazia Chaudhry, Rayner Gabriel, Richard Rohan, Henry W. Kramer, Scott McCormick, Mort Shelby, and Rose Elizabeth Supan.</p>"; 
